import React, { useState, useEffect, useReducer } from 'react';
import AccountDropDownMenu from './AccountDropDownMenu';
import LoginRegisterComponent from './LoginRegisterComponent';



const VariableNavButtons = ({ user, setUser }) => {
  const [loggedIn, setLoggedIn] = useState(false);

  if (user.email) {
    return(<AccountDropDownMenu user={user} setUser={setUser} />);
  } else {
    return(<LoginRegisterComponent />);
  }

};

export default VariableNavButtons;
